import React from "react";
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';

function Header() {
  return (
    <div>
      <h1>MP Studio</h1>
      <MenuIcon />
      {/* mp studio logo */}
      <input type="text" />
      <SearchIcon />
    </div>
  );
}

export default Header;
